import React, { useState, useEffect } from 'react';

const Card = () => {

    const [states, setStates] = React.useState([]);
    let statelist;
    const getStates = async () => {

        let url = "https://api.data.gov.in/resource/463d908b-c03b-47d3-b5bb-33d584d27f65?api-key=579b464db66ec23bdd000001cdd3946e44ce4aad7209ff7b23ac571b&format=json";
        let data = await fetch(url);
        let states = await data.json()
        console.log("data", states);
        statelist = states.records;
        console.log("statelist", statelist);
    }


    useEffect(() => {
        getStates();
    }, []);

    return (
        <div class="card">
            {statelist.map((element, index) => {
                return
                <div className=" col-sm-12 col-md-6 col-lg-4"
                    key={element.url}>
                </div>
            })}
        </div>
    )

}

export default Card;
